import React from "react";
const PaginationButton = ({ pageNumber, onClick }) => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-lg-2 col-md-6 col-sm-6 d-flex"></div>
        <button className="mx-1 mx-md-2 " onClick={onClick}>
          {pageNumber}
        </button>
      </div>
    </div>
  );
};

export default PaginationButton;
